/*
 * Starting and finishing from an "up" direction,
 * draw a pair of eyes to the right of the turtle,
 * where each eye is `size` width and `color`.
 * The total eye width will be size * 2.5
 */
const drawBase = (size, color) => {
  let shoulder = "#d4dce2";
  if (color == "home") {
    turtle.setFillStyle("#0c274a");
  } else if (color == "away") {
    turtle.setFillStyle("White");
    shoulder = "#0c274a";
  } else if (color == "throwback") {
    turtle.setFillStyle("#b10018");
    shoulder = "white";
  }
  turtle.beginPath();
  turtle.left(90);
  turtle.forward(50 * size);
  turtle.left(45);
  for (let i = 0; i < 2; i++) {
    turtle.forward(70 * size);
    turtle.left(90);
  }
  turtle.forward(40 * size);
  turtle.right(135);
  turtle.forward(200 * size);
  turtle.left(90);
  turtle.forward(170 * size);
  turtle.left(90);
  turtle.forward(200 * size);
  turtle.right(135);
  turtle.forward(40 * size);
  for (let i = 0; i < 2; i++) {
    turtle.left(90);
    turtle.forward(70 * size);
  }
  turtle.left(45);
  turtle.forward(50 * size);
  turtle.left(15);
  turtle.arc(246 * size, 30);
  turtle.closePath();
  turtle.fill();
  turtle.penUp();
  turtle.setFillStyle(shoulder);
  turtle.left();
  turtle.left(90);
  turtle.forward(20 * size);
  turtle.beginPath();
  turtle.forward(30 * size);
  turtle.left(45);
  turtle.forward(30 * size);
  turtle.left(90);
  turtle.penDown();
  turtle.forward(70 * size);
  turtle.left();
  turtle.forward(70 * size);
  turtle.closePath();
  turtle.fill();
  if (color == "throwback") {
    turtle.setFillStyle("darkBlue");
    turtle.left(90);
    turtle.beginPath();
    turtle.forward(30 * size);
    turtle.left(45);
    turtle.forward(30 * size * 0.5);
    turtle.left(90);
    turtle.penDown();
    turtle.forward(70 * size * 0.5);
    turtle.left();
    turtle.forward(71 * size * 0.5);
    turtle.closePath();
    turtle.fill();
    turtle.penUp();
    turtle.right(90);
    turtle.forward(15 * size);
    turtle.setFillStyle(shoulder);
  } else {
    turtle.penUp();
    turtle.forward(size);
    turtle.right(90);

  }
  turtle.forward(170 * size);
  turtle.beginPath();
  turtle.forward(30 * size);
  turtle.right(45);
  turtle.forward(30 * size);
  turtle.penDown();
  turtle.right(90);
  turtle.forward(70 * size);
  turtle.right();
  turtle.forward(70 * size);
  turtle.closePath();
  turtle.fill();
  if (color == "throwback") {
    turtle.setFillStyle("darkblue");
    turtle.right(90);
    turtle.beginPath();
    turtle.forward(30 * size);
    turtle.right(45);
    turtle.forward(30 * size * 0.5);
    turtle.right(90);
    turtle.penDown();
    turtle.forward(70 * size * 0.5);
    turtle.right();
    turtle.forward(70 * size * 0.5);
    turtle.closePath();
    turtle.fill();
    turtle.penUp();
    turtle.left(90);
    turtle.forward(15 * size);
    turtle.right(90);
  }
};

